import React from 'react';
import Search from './Search';
import TaskToggle from './TaskToggle';
import WorkOrderToggle from './WorkOrderToggle';
import AddWorkOrderBtn from './AddWorkOrderBtn';
import EmployeesToggle from './EmployeesToggle';
import AddEmployeeBtn from './AddEmployeeBtn';
import AddCustomerBtn from './AddCustomerBtn';

import '../../styles/sidebar.scss';

const Sidebar = () => {
    return (
        <div className="sidebar">
            <Search />
            <TaskToggle />
            <WorkOrderToggle />
            <AddWorkOrderBtn />
            <EmployeesToggle />
            <AddEmployeeBtn />
            <AddCustomerBtn />
        </div>
    );
};

export default Sidebar;
